dts:
declare module 'vitest' {
  import { Test } from '@vitest/core';
  import { Reporter } from '@vitest/reporter';

  declare global {
    interface Window {
      vitest: {
        test: typeof Test;
        reporter: typeof Reporter;
      };
    }
  }

  export const test: typeof Test;
  export type Test = typeof Test;

  export const reporter: typeof Reporter;
  export type Reporter = typeof Reporter;
}
